ess has already been registered to the newsletter To unsubscribe from our newsletter, please contact us.   Call us +230 4033900+230 4033900   The genuine spiritSituated along the breathtaking sunset coast and bordered by scintillating turquoise waters, La Pirogue offers guests an incredible four-star experience in paradise. Imbued with authentic and unrivalled Mauritian charm, La Pirogue resembles a traditional fishing village, each bungalow’s thatched roof reminiscent of the unfurled sail of a local fishing boat, from which the resort derives its name. Set amongst a coconut grove and surrounded by lush gardens, this boho-chic hotel boasts a relaxed atmosphere that is still vibrant—perfect for both families and couples alike.Read more  Sun Memory Lab   Sun Memory Lab  Sun Golf   Sun Golf   Timeless Memories The best memories come from treasured moments shared with loved ones and created though unusual experiences in special places. Our Mauritian charm permeates everything we do to ensure that our guests can enjoy unique and authentic experiences that delight and surprise them so that their phenomenal holiday moments turn into memories that last a lifetime.Sunrise and Sunset  Sunrise and Sunset  Sun Mixology  Sun Mixology  Sun Kids  Sun Kids  Sun Luxury Moments  Sun Luxury Moments  Sun Beach  Sun Beach    AccommodationBeach pavilionsIndividual single Pavilions each with their own private terrace located only metres away from the beach, offering… View roomsGarden BungalowFacing the resort’s lush coconut grove, these rooms offer a convivial and cosy atmosphere in thatched and grounded bungalows… View roomsPremium Garden bungalowUnique semi-detached thatch roofed bungalows, each with its own furnished terrace offering sea view, located far from the… View roomsSenior suite pavilionsPersonalised service in our elegant tropical luxury ground floor suite, located in a unique individual thatched roof… View roomsBeach pavilionsIndividual single Pavilions each with their own private terrace located only metres away from the beach, offering… View rooms  ActActivities Families and couples flock to the white sandy shores of La Pirogue seeking more than its tranquil atmosphere and Mauritian charm. Make the most of our gorgeous beach with the plethora of land- and water-based activities, indulge in days spent on the beach or retreat to the tranquillity of our spa— we have everything you desire for your dream holiday in Mauritius.Water Sports and Diving     Water Sports and DivingEscapes and Excursions     Escapes and ExcursionsIle aux Cerfs     Ile aux CerfsFitness     FitnessFishing     FishingWellbeing     WellbeingMusic Studio     Music Studio  Sun Resorts Trust you block Overall guest ratings4.6Excellent         2,261 reviews
